import logo from './logo.svg';
import './App.css';

function App() {
  const context = useContext(AuthContext);

  return (
    <Layout>
      <Switch>
        <Route path='/' exact>
          <div className='container'>
            <div className='row mt-3'>
              <div className='col-md-12'>
                <AuthPage />
              </div>
            </div>
            <hr/>
            <div className=''>
              <p>@ Online Classrooms -2022</p>
            </div>
          </div>
        </Route>
        <Route path='*'>
          <Redirect to='/' />
        </Route>
      </Switch>
    </Layout>
  );
}

export default App;
